import { Card } from "antd";
import React from "react";

class AssignmentDetail extends React.PureComponent {
  render() {
    return (
      <Card title="Card title">
        <Card
          style={{ marginTop: 16 }}
          type="inner"
          title="Inner Card title"
          extra={<a href="#">More</a>}
        >
          Inner Card content
        </Card>
      </Card>
    );
  }
}
export default AssignmentDetail;
